def plot_delay():
    plt.rcParams["font.weight"] = "bold"
    plt.rcParams["axes.labelweight"] = "bold"

    down_x_label = 'Inter Load (Gbps) '
    y_label = 'Total end-to-end delay (msec)'
    legend_loc = 'upper left'

    LOAD=waa_load_total_bps_avg
    DELAY=waa_delay_total_avg
    THRU=waa_thru_total_bps_avg
    DELAY_high=waa_delay_high_avg
    DELAY_med=waa_delay_med_avg
    DELAY_low=waa_delay_low_avg
    # Clean my loads
    selected_i = []
    for i in range(0, len(LOAD)):
        if LOAD[i] != 0 and THRU[i] <= LOAD[i] \
                and THRU[i]<=160e9:
            selected_i.append(i)

    X = [LOAD[i] / 1e9 for i in selected_i]
    X.insert(0, 0)
    Y = [DELAY[i] *1000 for i in selected_i]
    Y.insert(0, 0)
    Z1 = [DELAY_high[i] *1000 for i in selected_i]
    Z1.insert(0, 0)
    Z2 = [DELAY_med[i] *1000 for i in selected_i]
    Z2.insert(0, 0)
    Z3 = [DELAY_low[i] *1000 for i in selected_i]
    Z3.insert(0, 0)

    fig, ax1 = plt.subplots(constrained_layout=True)

    ax1.plot(X, Y, 'k', label="Inter Average Delay", linewidth=4)
    ax1.plot(X, Z1, 'r', label="High Delay", linewidth=4)
    ax1.plot(X, Z2, 'b', label="Med Delay", linewidth=4)
    ax1.plot(X, Z3, 'g', label="Low Delay", linewidth=4)

    try:
        ax1.set_xlabel(down_x_label, fontsize=25)
    except:
        pass
    try:
        ax1.set_ylabel(y_label, fontsize=25)
    except:
        pass
    try:
        ax1.legend(loc=legend_loc, fontsize=15)
    except:
        ax1.legend(loc='upper left', fontsize=15)
    ax1.grid(True, which='major', axis='both')
    ax1.tick_params(axis='both', which='major', labelsize=20)
    ax1.tick_params(axis='both', which='minor', labelsize=8)
    plt.show()
plot_delay()
plot_thru('all')
